@prefix : <http://www.semanticweb.org/ontologies/atm#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

:InvalidPinError rdf:type owl:Class .

:hasInvalidPinAttempt rdf:type owl:ObjectProperty ;
    rdf:domain :ATM ;
    rdf:range :InvalidPinAttempt.

:InvalidPinAttempt rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty :hasInvalidPinAttempt ;
                      owl:qualifiedCardinality "3"^^xsd:nonNegativeInteger ;
                      owl:onClass :InvalidPinError ] . 

:displays rdf:type owl:ObjectProperty ;
    rdf:domain :ATM ;
    rdf:range :ErrorMessage.

:ErrorMessage rdf:type owl:Class ;
    rdfs:subClassOf [ rdf:type owl:Restriction ;
                      owl:onProperty :displays ;
                      owl:someValuesFrom :InvalidPinError ] .
